import React from 'react'
import { HashRouter, Routes, Route } from 'react-router-dom'
import Header from './Pages/Header'

function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/" element={<Header/>}/>
      </Routes>
    </HashRouter>
  )
}

export default App
